import React from "react";
import { connect } from "react-redux";
import { getBookingList } from "../../../redux/action/admin/booking/action"
import { Link } from "react-router-dom";

class BookingList extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            bookings : []
        }       
    }

    componentDidMount() {
        this.props.getBooking().then(() => {
            this.setState({
                bookings : this.props.bookings
            });
        });
    }

    render(){

        return (
            <div>
                <h3>Manage Bookings</h3>
                <div >
                    {
                        (this.state.bookings.length > 0) ? (
                            <table className="table">
                                <thead>
                                    <tr>
                                    <th scope="col">#</th>
                                    <th scope="col">Name</th>
                                    <th scope="col">Vehicle</th>
                                    <th scope="col">From Date</th>
                                    <th scope="col">To Date</th>
                                    <th scope="col">Message</th>
                                    <th scope="col">Status</th>
                                    <th scope="col">Posting Date</th>
                                    <th scope="col">Action</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {

                                        this.state.bookings.map( el => (
                                            <tr key={el.id}>
                                                <td>{el.FullName}</td>
                                                <td>{el.VehiclesTitle}</td>
                                                <td>{el.FromDate}</td>
                                                <td>{el.ToDate}</td>
                                                <td>{el.message}</td>
                                                <td>{
                                                 () => {
                                                     if(el.status == 0) {
                                                        return( <span>Not Confirmed yet</span>)
                                                     }else if(el.status == 1) {
                                                        return( <span>Confirmed</span>) 
                                                     }else if(el.status == 1) {
                                                        return <span>Cancelled</span>
                                                     }
                                                 }
                                                }</td>

                                                <td>{el.CreationDate}</td>
                                                <td>{el.UpdationDate}</td>
                                                <td>
                                                    <Link to={`/admin/brand/manage/edit/${el.id}`}>update</Link>
                                                    <a className="ml-2" href="#" onClick={
                                                        () => this.removeBrand(el.id)
                                                        }>Delete</a>
                                                </td>
                                            </tr>
                                        ))
                                    }


                                </tbody>
                            </table>

                        ) : (
                            <h3>Loading</h3>
                        )
                    }

                </div>
            </div>
        )

    }
}

const mapStateToProps = (state) => {
    const booking = state.booking;

    return {
        bookings : booking.booking_list
    }
}

const dispatchStateToProps = (dispatch) => {
    return {
        getBooking : () => dispatch(getBookingList())
    }
}

export default connect(mapStateToProps,dispatchStateToProps)(BookingList);
